import React from 'react'
import './css/card.css';
import { Route } from 'react-router-dom';

function Card(item) {

  const clicked = () => {
    console.log("onclick")
    return(
      <Route to='/messages'></Route>
    )
  }
  return (
    <div className="side">
        <img onClick={clicked} src={item.val} className='pic' alt="error" /> 
        <p>{item.textval} </p>
    </div>
  );
}

export default Card;
